import React from "react";


function NavBarItem(props) {
    return (
        <li className="nav-item">
            <a className="nav-link" href={props.href} style={{fontSize: 20, fontWeight: "bold"}} >{props.label}</a>
        </li>
    );
}
export default NavBarItem;
